INSERT INTO `requirement_table` (`id_standard`, `details`, `topic_standart`) VALUES
(1, '<p><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiRHJuc0xpYVBNMk5GSWdwbHlOVHRJYyIsInBhc3RlSUQiOjgzNjM1MTUyOSwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span><span style=\"white-space-collapse: preserve;\"><b>4.1 Understanding the organization and its context</b><br>The organization shall determine external and internal issues that are relevant to its purpose and that<br>affect its ability to achieve the intended outcome(s) of its information security management system.\n<br>NOTE Determining these issues refers to establishing the external and internal context of the organization<br>considered in Clause 5.4.1 of ISO 31000:2018[5].\n</span></p>', '<b>ISO/IEC 27001:2022</b><br><p><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoidE54UHJubWlzSGw5bGZBQjQ1VUU3RyIsInBhc3RlSUQiOjE3OTcxMTA0OTMsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\"></span></p>');
INSERT INTO `requirement_table` (`id_standard`, `details`, `topic_standart`) VALUES
(2, '<p><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiRHJuc0xpYVBNMk5GSWdwbHlOVHRJYyIsInBhc3RlSUQiOjEwNjkyMTkxNywiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span><span style=\"white-space-collapse: preserve;\"><b>4.2 Understanding the needs and expectations of interested parties</b><br>The organization shall determine:<br>a) interested parties that are relevant to the information security management system;<br>b) the relevant requirements of these interested parties;<br>c) which of these requirements will be addressed through the information security management system.<br><br>NOTE The requirements of interested parties can include legal and regulatory requirements and contractual obligations.</span><br></p>', '<b>ISO/IEC 27001:2022</b><br><p><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoidE54UHJubWlzSGw5bGZBQjQ1VUU3RyIsInBhc3RlSUQiOjE3OTcxMTA0OTMsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\"></span></p>');
INSERT INTO `requirement_table` (`id_standard`, `details`, `topic_standart`) VALUES
(3, '<p><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiRHJuc0xpYVBNMk5GSWdwbHlOVHRJYyIsInBhc3RlSUQiOjk5MjIyMDYyMiwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span><span style=\"white-space-collapse: preserve;\"><b>4.3 Determining the scope of the information security management system\r\n</b><br>The organization shall determine the boundaries and applicability of the information security management system to establish its scope.\r\n<br>When determining this scope, the organization shall consider:</span></p><p><span style=\"white-space-collapse: preserve;\"><br>a) the external and internal issues referred to in 4.1;<br>b) the requirements referred to in 4.2;<br>c) interfaces and dependencies between activities performed by the organization, and those that are<br>performed by other organizations.<br><br>The scope shall be available as documented information.</span><br></p>', '<b>ISO/IEC 27001:2022</b><br><p><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoidE54UHJubWlzSGw5bGZBQjQ1VUU3RyIsInBhc3RlSUQiOjE3OTcxMTA0OTMsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\"></span></p>');
INSERT INTO `requirement_table` (`id_standard`, `details`, `topic_standart`) VALUES
(4, '<p><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiRHJuc0xpYVBNMk5GSWdwbHlOVHRJYyIsInBhc3RlSUQiOjM0MzA5MTY3NywiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span><span style=\"white-space-collapse: preserve;\"><b>4.4 Information security management system<br></b><br>The organization shall establish, implement, maintain and continually improve an information security management system, including the processes needed and their interactions, in accordance with the requirements of this document.</span><br></p><div><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiRHJuc0xpYVBNMk5GSWdwbHlOVHRJYyIsInBhc3RlSUQiOjEyMDMxMTkyODcsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span></div><div><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiRHJuc0xpYVBNMk5GSWdwbHlOVHRJYyIsInBhc3RlSUQiOjEyMDMxMTkyODcsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span></div><div><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiRHJuc0xpYVBNMk5GSWdwbHlOVHRJYyIsInBhc3RlSUQiOjEyMDMxMTkyODcsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span></div>', '<p><b>ISO/IEC 27001:2022</b><br></p>');
INSERT INTO `requirement_table` (`id_standard`, `details`, `topic_standart`) VALUES
(5, '<p><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiRHJuc0xpYVBNMk5GSWdwbHlOVHRJYyIsInBhc3RlSUQiOjIwMDkzNjEzMjAsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span><span style=\"white-space-collapse: preserve;\"><b>5.1 Leadership and commitment<br></b><br>Top management shall demonstrate leadership and commitment with respect to the information<br>security management system by:<br><br>a) ensuring the information security policy and the information security objectives are established<br>and are compatible with the strategic direction of the organization;<br>b) ensuring the integration of the information security management system requirements into the<br>organization’s processes;<br>c) ensuring that the resources needed for the information security management system are available;<br>d) communicating the importance of effective information security management and of conforming<br>to the information security management system requirements;<br>e) ensuring that the information security management system achieves its intended outcome(s);<br>f) directing and supporting persons to contribute to the effectiveness of the information security<br>management system;<br>g) promoting continual improvement; and<br>h) supporting other relevant management roles to demonstrate their leadership as it applies to their<br>areas of responsibility.  </span></p><p><span style=\"white-space-collapse: preserve;\"><br></span></p><p><span style=\"white-space-collapse: preserve;\">NOTE Reference to “business” in this document can be interpreted broadly to mean those activities that are<br> core to the purposes of the organization’s existence.</span><br></p>', '<p><b>ISO/IEC 27001:2022</b><br></p>');
INSERT INTO `requirement_table` (`id_standard`, `details`, `topic_standart`) VALUES
(6, '<p><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiRHJuc0xpYVBNMk5GSWdwbHlOVHRJYyIsInBhc3RlSUQiOjg1MTIzMjg4OSwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span><span style=\"white-space-collapse: preserve;\"><b>5.2 Policy<br></b><br>Top management shall establish an information security policy that:<br>a) is appropriate to the purpose of the organization;<br>b) includes information security objectives (see 6.2) or provides the framework for setting information<br>security objectives;<br>c) includes a commitment to satisfy applicable requirements related to information security;<br>d) includes a commitment to continual improvement of the information security management system.<br>\r\n<br>The information security policy shall:<br>e) be available as documented information;<br>f) be communicated within the organization;<br>g) be available to interested parties, as appropriate.</span><br></p><div><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiRHJuc0xpYVBNMk5GSWdwbHlOVHRJYyIsInBhc3RlSUQiOjE4ODY4MTU5MjMsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span></div>', '<p><b>ISO/IEC 27001:2022</b><br></p>');
INSERT INTO `requirement_table` (`id_standard`, `details`, `topic_standart`) VALUES
(7, '<p><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiRHJuc0xpYVBNMk5GSWdwbHlOVHRJYyIsInBhc3RlSUQiOjY5MjQxMjQ5MSwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span><span style=\"white-space-collapse: preserve;\"><b>5.3 Organizational roles, responsibilities and authorities<br></b><br>Top management shall ensure that the responsibilities and authorities for roles relevant to information<br>security are assigned and communicated within the organization.\r\n<br>Top management shall assign the responsibility and authority for:\r\n<br>a) ensuring that the information security management system conforms to the requirements of this<br>document;<br>b) reporting on the performance of the information security management system to top management.\r\n<br>NOTE Top management can also assign responsibilities and authorities for reporting performance of the<br>information security management system within the organization.</span><br></p><div><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiRHJuc0xpYVBNMk5GSWdwbHlOVHRJYyIsInBhc3RlSUQiOjE1OTIyODAzMjIsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span></div><div><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiRHJuc0xpYVBNMk5GSWdwbHlOVHRJYyIsInBhc3RlSUQiOjE1OTIyODAzMjIsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span></div><div><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiRHJuc0xpYVBNMk5GSWdwbHlOVHRJYyIsInBhc3RlSUQiOjE1OTIyODAzMjIsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span></div>', '<p><b>ISO/IEC 27001:2022</b><br></p>');

